const btn = document.querySelector('#crear_caratula');

btn.addEventListener('click', () => {

    const solicitante = document.querySelector('#solicitante').value;
    const paciente = document.querySelector('#paciente').value;



    imprimir(solicitante, paciente);
})

function imprimir(solicitante, paciente) {
    const pdf = new jsPDF();

    const titulo = 'Laboratorio de análisis clínicos'
    const subtitlo = 'Mariano Moreno'
    const direccion = 'Alvear 760 - Centro'
    const localidad = 'San Salvador de Jujuy'

    const img = "data:image/jpeg;base64, \
     \
     \
    "
    

    pdf.addImage(img, 'JPG', 60, 80, 75, 60)

    const text_solicitante = 'Solicitante:'
    const text_paciente = 'Paciente:'

    const solici = solicitante
    const paci = paciente

    //Titulo
    pdf.setFont('helvetica', 'bold');
    pdf.setTextColor(69, 130, 236) //Celeste
    pdf.setFontSize(20);
    pdf.text(titulo, 53, 30)

    pdf.setFontSize(40);
    pdf.text(subtitlo, 51, 50)

    pdf.setFont('helvetica', 'normal');
    pdf.setTextColor( 0, 0, 0 ) //negro
    pdf.setFontSize( 12 );
    pdf.text(text_solicitante, 10, 180)
    pdf.text(text_paciente, 10, 190)

    pdf.setFont('helvetica', 'bold');
    pdf.text(solici, 35, 180)
    pdf.text(paci, 30, 190)

    pdf.setFont('helvetica', 'bold');
    pdf.setTextColor(69, 130, 236) //Celeste
    pdf.setFontSize(20);
    pdf.text(direccion, 73, 230)
    pdf.text(localidad, 67, 250)






    window.open(pdf.output('bloburl'))

}

function toDataURL(url, callback) {
    var xhr = new XMLHttpRequest();
    xhr.onload = function () {
        var reader = new FileReader();
        reader.onloadend = function () {
            callback(reader.result);
        }
        reader.readAsDataURL(xhr.response);
    };
    xhr.open('GET', url);
    xhr.responseType = 'blob';
    xhr.send();
}